import {useState} from "react";
import moment from "moment";
export function LazyLoadingDemo(){
    let [time,setTime]=useState(Date.now());
    function changeTime(){
        setTime(moment(Date.now()).format());
    }
    return (
        <div>
        <div>{time}</div>
        <button onClick={changeTime}>
        格式化时间
        </button>
    </div>

)
}
